  `emp_id` int(11) NOT NULL,
  KEY `emp_id` (`emp_id`),
  KEY `alert_id` (`alert_id`),
  CONSTRAINT `alert_people_ibfk_1` FOREIGN KEY (`emp_id`) REFERENCES `employee` (`emp_id`),
  CONSTRAINT `alert_people_ibfk_2` FOREIGN KEY (`alert_id`) REFERENCES `alert` (`alert_id`)
);
